import SiteLogo from '../Images/wildsteppe_logo.png';
import SiteName from '../Images/Wildsteppe_name.png';


function Home() {
    return (
        <div id="splash_image">
            <div className='text-center'>
                <div>
                    <img id="" src={SiteLogo} alt='site logo'/>    
                </div>
                <div>
                    <img id="" className="" src={SiteName} alt='site name'/>
                </div>
            </div>
            Home Page
        </div>
    )
}

export default Home;
